var title_f14_52_15180="Risk of severe reactivation of HBV";
var content_f14_52_15180=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F86868&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F86868&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Risk of severe reactivation of HBV",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"3\" width=\"33%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Immunosuppression",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        Risk of severe reactivation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        HBsAg+",
"       </td>",
"       <td class=\"subtitle2\">",
"        HBsAg-, anti-HBc+",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Cancer chemotherapy",
"       </td>",
"       <td>",
"        High",
"       </td>",
"       <td>",
"        Moderate",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Marked immunosuppressive treatments such as regimens that include rituximab or long-term corticosteroid",
"       </td>",
"       <td>",
"        High",
"       </td>",
"       <td>",
"        Moderate",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        Other immunosuppressive treatments such as anti-TNF for rheumatologic, dermatologic, or gastroenterologic conditions",
"       </td>",
"       <td>",
"        Moderate",
"       </td>",
"       <td>",
"        Low",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Solid organ transplantation",
"       </td>",
"       <td rowspan=\"3\">",
"        High",
"       </td>",
"       <td>",
"        Increased cumulative risk over years",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Monitor for HBsAg reappearance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Test for HBV DNA if ALT elevated",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"4\">",
"        Allogeneic bone marrow/hematopoietic stem cell transplant",
"       </td>",
"       <td rowspan=\"4\">",
"        High",
"       </td>",
"       <td>",
"        Moderate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Monitor for HBsAg reappearance, especially if donor is not immune to hepatitis B",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Test for HBV DNA if ALT elevated",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Consider vaccinating donor prior to transplantation",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Short course of corticosteroids (eg, for asthmatic attack or allergic reaction)",
"       </td>",
"       <td>",
"        Low",
"       </td>",
"       <td>",
"        Low",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Prophylactic antiviral is recommended for settings with a high risk of HBV reactivation. Monitoring and initiation of antiviral therapy as needed is recommended for settings with a low risk of HBV reactivation. Management should be individualized for settings with a moderate risk of HBV reactivation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
