var title_f14_52_15181="Big endothelin outcome HF";
var content_f14_52_15181=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F58488&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F58488&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Big endothelin-1 predicts outcome in heart failure",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 271px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Kaplan-Meier analysis shows that the cumulative event-free survival (free of death or prioritization for urgent transplant) in 218 patients with stable, chronic heart failure is higher in those with a big endothelin (ET)-1 concentration &lt;4.3 fmol/ml compared to those with a concentration &ge;4.3 fmol/ml (p &lt;0.0001).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Hulsmann M, Stanek B, Frey B. J Am Coll Cardiol 1998; 32:1695.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
